import React from 'react';

const ItemImg = () => {
    return (
        <div className="w-[289.94px] h-[289.94px] relative rounded-[20px] border-2 border-zinc-800">
            <img className="w-[289.94px] h-[289.94px] left-0 top-0 absolute rounded-[20px] border border-neutral-400"
                 src="https://via.placeholder.com/290x290"/>
        </div>
    );
};

export default ItemImg;
